	@Override
	public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
		if (oldVersion < 21){
			db.execSQL("DROP TABLE IF EXISTS " + TABLE_LIGNE + ";");
			db.execSQL("DROP TABLE IF EXISTS " + TABLE_PARAM + ";");
			db.execSQL("DROP TABLE IF EXISTS " + TABLE_FAV + ";");
			db.execSQL("DROP TABLE IF EXISTS " + TABLE_STATION + ";");
			onCreate(db);
		}
		else{
			// mise à jour minimal des données
			// ne pas mettre de break afin que les action s'enchaine jusqu'à la version actuel
			switch (oldVersion){
				case 22:
					// mise à jour 21 vers 22
					db.execSQL("DROP TABLE IF EXISTS "+ TABLE_LIGNE +";");
					db.execSQL("DROP TABLE IF EXISTS "+ TABLE_STATION +";");
					insert_KeolisLine(db);
			}
		}
	}
	
